import { configureStore, createSlice, type PayloadAction } from "@reduxjs/toolkit"

export interface Product {
  id: string
  name: string
  price: number
  image: string
  category: string
}

export interface CartItem extends Product {
  quantity: number
}

interface CartState {
  items: CartItem[]
  total: number
}

interface ProductState {
  products: Product[]
  currentCategory: string
}

const initialCartState: CartState = {
  items: [],
  total: 0,
}

const initialProductState: ProductState = {
  products: [
    {
      id: "1",
      name: "Traditional Lehenga",
      price: 15999,
      image: "data:image/jpeg;base64,",
      category: "M1",
    },
    { id: "2", name: "Designer Saree", price: 12999, image: "data:image/jpeg;base64,", category: "M1" },
    {
      id: "3",
      name: "Bridal Collection",
      price: 25999,
      image: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcT20LIN-VLN8j3TnuGd5amvdE_zHESWOZPxdA&s",
      category: "M1",
    },
    { id: "4", name: "Festive Wear", price: 8999, image: "data:image/jpeg;base64,", category: "M2" },
    { id: "5", name: "Party Dress", price: 11999, image: "data:image/jpeg;base64,", category: "M2" },
    { id: "6", name: "Wedding Special", price: 18999, image: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcR9ciQ122HiOkmAvB5xurboKCZGxVvOlwXnyg&s", category: "M2" },
    { id: "7", name: "Casual Kurta", price: 3999, image: "data:image/jpeg;base64,", category: "M3" },
    { id: "8", name: "Ethnic Wear", price: 6999, image: "data:image/jpeg;base64,", category: "M3" },
    { id: "9", name: "Traditional Set", price: 9999, image: "data:image/jpeg;base64,", category: "M3" },
  ],
  currentCategory: "M1",
}

const cartSlice = createSlice({
  name: "cart",
  initialState: initialCartState,
  reducers: {
    addToCart: (state, action: PayloadAction<Product>) => {
      const existingItem = state.items.find((item) => item.id === action.payload.id)
      if (existingItem) {
        existingItem.quantity += 1
      } else {
        state.items.push({ ...action.payload, quantity: 1 })
      }
      state.total = state.items.reduce((sum, item) => sum + item.price * item.quantity, 0)
    },
    removeFromCart: (state, action: PayloadAction<string>) => {
      state.items = state.items.filter((item) => item.id !== action.payload)
      state.total = state.items.reduce((sum, item) => sum + item.price * item.quantity, 0)
    },
    updateQuantity: (state, action: PayloadAction<{ id: string; quantity: number }>) => {
      const item = state.items.find((item) => item.id === action.payload.id)
      if (item) {
        item.quantity = action.payload.quantity
      }
      state.total = state.items.reduce((sum, item) => sum + item.price * item.quantity, 0)
    },
  },
})

const productSlice = createSlice({
  name: "products",
  initialState: initialProductState,
  reducers: {
    setCategory: (state, action: PayloadAction<string>) => {
      state.currentCategory = action.payload
    },
  },
})

export const { addToCart, removeFromCart, updateQuantity } = cartSlice.actions
export const { setCategory } = productSlice.actions

export const store = configureStore({
  reducer: {
    cart: cartSlice.reducer,
    products: productSlice.reducer,
  },
})

export type RootState = ReturnType<typeof store.getState>
export type AppDispatch = typeof store.dispatch
